import Jumbotron from './components/Jumbotron';
import ImageThumbnail from './components/ImageThumbnail';
import React, { Component } from "react";

const data = [{src:"../images/arya.jpeg"},{src:"../images/bran.jpeg"}];

class App extends Component{

  state = {
    imgCast:data
  }

  render(){
    return (
      <div>
        <Jumbotron />
        <div className="container">
          <div className="row">
            <div className="col">
              <ImageThumbnail src={this.state.imgCast.map((item, i) =>{return(item.src)})}/>
            </div>
          </div>
        </div>
      </div>
        );
  }
};

export default App;
